  ];

  return (
    <div className="work-page">
      <h1>my work</h1>
      <div className="card-container">
        {projectsData.map((project, index) => (
          <Card
            key={index}
            link={project.link}
            title={project.title}
            description={project.description}
          />
        ))}
      </div>
    </div>
  );
};

export default Work;
